import React from "react";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';


import Login from "../pages/Login";
import Cadastro from "../pages/Cadastro"
import Testo from "../pages/Testo";
import Noticia from "../pages/Noticias";


const Stack = createNativeStackNavigator()
const Tab = createBottomTabNavigator();

function Tabs() {
    return (
        <Tab.Navigator>
            <Tab.Screen name="Noticia" component={Noticia} />
            <Tab.Screen name="Testo" component={testo} />
            <Tab.Screen name="Pagina2" component={Pagina2} />
            <Tab.Screen name="Pagina3" component={Pagina3} />
        </Tab.Navigator>
    )
}

export default function Routes() {
    return (
        <Stack.Navigator>
            <Stack.Screen
                name="Login"
                component={Login} />
            <Stack.Screen
                name="Cadastro"
                component={Cadastro} />
            <Stack.Screen
                name="Testo"
                component={Testo} />
            <Stack.Screen
                name="Noticia"
                component={Noticia} />
        </Stack.Navigator>

    );
}
